export const getController = (Model) => {
    return {
        getAll: async (req, res) => {
            try {
                const all = await Model.find()
                res
                    .status(200)
                    .json(all)
            } catch (err) {
                res
                    .status(400)
                    .json({
                        message: err
                    })
            }
        },
        saveObject: async (req, res) => {
            const body = req.body
            try {
                const savedObject = await Model.create(body)
                res
                    .status(200)
                    .json(savedObject)
            } catch (err) {
                res
                    .status(500)
                    .json({
                        message: err
                    })
            }
        },
        getObject: async (req, res) => {
            const _id = req.params.id;
            try {
              const object = await Model.findOne({_id});
              res
                .status(200)
                .json(object)
            } catch (err) {
              res
                .status(400)
                .json({
                  message: err
                })
            }
        },
        deleteObject: async (req, res) => {
            const _id = req.params.id;
            try {
              const revomedObject = await Model.findByIdAndDelete({_id});
        
              if (!revomedObject) {
                return res.status(404).json({
                  message: err
                })
              }
        
              res.json(revomedObject)
            } catch (err) {
              res
                .status(400)
                .json({
                  message: err
                })
            }
        },
        updateObject: async (req, res) => {
            const _id = req.params.id;
            const body = req.body;
            try {
              const updatedObject = await Model.findByIdAndUpdate(
                _id,
                body,
                {new: true});
        
              if (!updatedObject) {
                return res.status(404).json({
                  message: err
                })
              }
              res.status(200).json(updatedObject)

            } catch (err) {
              res
                .status(500)
                .json({
                  message: err
                })
            }
        }
    }
}
